  [],\n\t\"revision_timestamp\": \"2015-09-27T01:53:22.179449\",\n\t\"name\": \"climate-record-books\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Climate Record Books contain daily, monthly,
  seasonal, and annual averages, extremes, or occurrences. Most data are sequential
  by period of record 1871-1910, 1911-1930, 1931-1950, 1951-1970, and 1971-1990. Climatological
  Record Books are prepared and maintained by National Weather Service stations and
  offices. These books present detailed climatological data for an individual station,
  or office, for a long period of years. Data are arranged by element by years. The
  first volume, 1871-1910, was prepared for 202 stations although not all stations
  had the full period of record. The second volume 1911-1930, is available for 228
  stations, the third volume, 1931-1950, is available for 247 stations, and the fourth
  volume, 1951-1970, is available for 324 stations.\",\n\t\"license_title\": null,\n\t\"extras\":
